            src="https://open.spotify.com/embed/playlist/092HCAhRLB82mrvQc2u4A8?utm_source=generator" 
            width="100%" 
            height="380" 
            frameBorder="0" 
            allowfullscreen="" 
            allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture"></iframe>
        </div>
    );
};

export default YouTubeEmbed
